INSERT INTO `materi` VALUES (42, 'public/images/cTlyNGPbhFQjS9rt5dY0WWohnFlNSafjf4ciQCoy.png', 'public/documents/dfvoNf6kNUrt7YIcHwQkqxCGTzaAsKYXShi0r01O.html', 'Ayunan Bandul Sederhana', '<p><b><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjE1MzA0MzY2MjksImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\">Dasar Teori</span></b></p><p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjY3MzAxODc1NSwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\">Teori Gerak harmonis sederhana yang dapat dijumpai dalam kehidupan sehari-hari adalahgetaran benda pada pegas dan getaran benda pada ayunan sederhana. Kita akanmempelajarinya satu persatu. Gerak Harmonis Sederhana pada Ayunan.Ketika beban digantungkan pada ayunan dan tidak diberikan gaya maka benda akan diam dititik kesetimbangan B. Jika beban ditarik ke titik&nbsp;A dan dilepaskan, maka&nbsp;beban akan bergerakke B, C, lalu kembali lagi ke A. Gerakan beban akan terjadi berulang secara periodik, dengankata lain beban pada ayunan di atas melakukan gerak harmonik sederhana.Untuk menentukan gravitasi bumi dilakukan percobaan ayunan bandul sederhana denganperalatan sederhana. Dengan mengmati gerak harmonis bandul yang memiliki simpanganmaksimal 15°. Serta menentukan waktu yang diperlukan untuk 5, 10, atau 20 getaran denganpanjang tali yang berbeda-beda dan massa beban sebesar 0,05 Kg. Yang kemudian dihitungnilai gravitasinya dengan persamaan berikut:</span></p><p><img src=\"data:image/png;base64,\" data-filename=\"image 9.png\" style=\"width: 365.24px; height: 274.088px;\"><span style=\"white-space-collapse: preserve;\"><br></span></p><p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjEyMDk3NjkwMjIsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><b><span style=\"white-space-collapse: preserve;\">Cara Kerja</span></b></p><ol><li><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjk4MTEyOTgyOSwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\">Siapkan alat dan bahan yang akan digunakan.</span></li><li><span style=\"white-space-collapse: preserve;\">Letakkan statip pada tempat yang stabil.</span></li><li><span style=\"white-space-collapse: preserve;\">Ikatkan benang ke beban 50 gram.</span></li><li><span style=\"white-space-collapse: preserve;\">Kemudian lilitkan ujung tali lainnya pada klem yang diapit&nbsp;oleh statip.</span></li><li><span style=\"white-space-collapse: preserve;\">Ukurlah panjang tali sepanjang 40 cm dengan menggunakan mistar.</span></li><li><span style=\"white-space-collapse: preserve;\">Ayunkan beban&nbsp;yang telah diikat&nbsp;sepanjang 40 cm dengan simpangan&nbsp;maksimal sebesar 15°.</span></li><li><span style=\"white-space-collapse: preserve;\">Amati ayunan bandul hingga bergerak harmonis dan siapkan stopwatch.</span></li><li><span style=\"white-space-collapse: preserve;\">Hitung waktu sampai 10 ayunan menggunakan stopwatch.</span></li><li><span style=\"white-space-collapse: preserve;\">Catat waktu yang diperlukan untuk 10 ayunan sebesar t detik.</span></li><li><span style=\"white-space-collapse: preserve;\">Ulangi percobaan dengan panjang tali yang berbeda yakni 50 cm dan 60 cm, kemudianhitunglah waktu yang diperlukan menggunakan stopwatch.</span></li><li><span style=\"white-space-collapse: preserve;\">Lakukan langkah 6 dan 10 sampai&nbsp;3 kali percobaan</span></li><li><span style=\"white-space-collapse: preserve;\">Catat hasil percobaan pada tabel hasil&nbsp;pengamatan.</span></li></ol><p><img src=\"data:image/png;base64,\" data-filename=\"image 12.png\" style=\"color: var(--bs-body-color); font-size: 1rem; width: 485.025px; height: 178.4px;\"></p><p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjI1NzA0MDQ2MiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><a href=\"https://docs.google.com/spreadsheets/d/1NoLLVuuxqakzuA5b55tOirFcu3qW_4ce/edit?usp=drive_link&amp;ouid=112975382526266314729&amp;rtpof=true&amp;sd=true\" target=\"_blank\">Download Tabel Pengamatan</a></span><br></p><ol><li><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjIxMzQ4NTU4ODMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\">Bandingkan Hasil Percepatan gravitasi yang kamu dapatkan dari percobaan dengan Nilaiketetapan percepatan gravitasi (g=9,8 m/s^2)? Jelaskan!</span></li><li><span style=\"white-space-collapse: preserve;\">Bagaimana hubungan Panjang tali dengan periode bandul? Jelaskan!</span><br></li></ol>', '<p><b><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjUzOTU4NjkxOCwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\">Tujuan Percobaan</span></b></p><p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjE5NTA3Nzc1MTYsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\">Siswa dapat menentukan Besarnya Gravitasi dengan Menggunakan BandulMatematis/ayunan sederhana.</span></p><p><b><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjEwNjEwNDg1NjYsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\">Alat dan Bahan</span></b></p><ol><li><span style=\"white-space-collapse: preserve;\"><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjEwMjc3MTk0OTcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span>Beban 50 gram</span></li><li><span style=\"white-space-collapse: preserve;\">Benang (40,50, dan 60 cm)</span></li><li><span style=\"white-space-collapse: preserve;\">Mistar</span></li><li><span style=\"white-space-collapse: preserve;\">Penggaris Busur</span></li><li><span style=\"white-space-collapse: preserve;\">Stopwatch</span></li><li><span style=\"white-space-collapse: preserve;\">Statif dan Klem</span><br></li></ol>', 1, 10, NULL, '<p style=\"text-align: center; \"><b><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjE5NDE3NjA2NDcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve; font-size: 12px;\">Tokoh Fisika</span></b></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"image 13.png\" style=\"width: 134.926px; height: 165.5px;\"><span style=\"white-space-collapse: preserve;\"><br></span></p><p style=\"text-align: center;\"><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjE3NTE5MDc5NTcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve; font-size: 12px;\">Galileo Galilei</span></p><p style=\"text-align: center;\"><font color=\"#000000\"><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5IjoiTXZvVVZNMGoxZkRjWU1KdjVqV0RuWCIsInBhc3RlSUQiOjExNzM2OTgxOTcsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)-->\" style=\"\"></span><span data-buffer=\"<!--(figma)(/figma)-->\" style=\"\"></span><span style=\"white-space-collapse: preserve; font-size: 12px;\">15 Februari 1564 – 8 Januari 1642</span></font></p><p></p><p style=\"text-align: center;\"><span style=\"white-space-collapse: preserve; font-size: 12px;\"><a href=\"https://id.wikipedia.org/wiki/Revolusi_ilmiah\" target=\"_blank\">Galileo Galilei (lahir di Pisa, Toscana, 15 Februari 1564 – meninggal di Arcetri, Toscana, 8Januari 1642pada umur 77 tahun) Ia adalah seorang astronom, filsuf, dan fisikawan Italiayang memiliki peran besar dalam revolusiilmiah.Sumbangannya dalam keilmuan antara lain adalah penyempurnaan teleskop, berbagaipengamatan astronomi, dan hukum gerakpertama dan kedua(dinamika)</a></span><br></p><p></p>');
